import React from "react";
import { BrowserRouter, Route, Router, Routes } from "react-router-dom";
import Dashboard from "../../pages/Dashboard";
import DichVu from "../../pages/DichVu";
import DonHang from "../../pages/DonHang";
import KhachHang from "../../pages/KhachHang";
import KhuyenMai from "../../pages/KhuyenMai";
import Xe from "../../pages/Xe";

export default function AppRoutes() {
    return (

        <Routes>
            <Router path="/pagequantri" element={Dashboard}></Router>
            <Router path="/pagequantri/donhang" element={DonHang}></Router>
            <Router path="/pagequantri/dichvu" element={DichVu}></Router>
            <Router path="/pagequantri/xe" element={Xe}></Router>
            <Router path="/pagequantri/khuyenmai" element={KhuyenMai}></Router>
            <Router path="/pagequantri/khachhang" element={KhachHang}></Router>
            <Router path="/khachhang" element={KhachHang}></Router>

        </Routes>
    )
}
